                            <h1 className="jumboHeader1">Ready to Collaborate?</h1>
                            <h2 className="jumboHeader2">Good.</h2>
                        </Col>
                        <Col className="jumboCol">
                            <Button color="primary">Get Started</Button>
                        </Col>
                    </Row>
                    <Row className="breakpoint">
                        <h1>{breakpoint}</h1>
                    </Row>
                </Container>
                <JoinCreate />
                <SearchHomeBJ />
                <FeaturedProjects />
            </React.Fragment>
        )
    }
}

export default withRouter(Home);
